import React, { Component } from 'react';

export default class OneNote extends Component {
  constructor(props) {
    super(props);
  }
  render() {

    const style = { border: "1px solid cyan", padding: "1rem", margin: "1rem" };
    return(
      <div style={style}>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
        <hr></hr>
        <h3>Hello One Note!</h3>
    </div>
    )
  }
}
